import { RiDeleteBin2Line, RiRefreshLine } from "react-icons/ri";
import Button from "../UI/Button";

function TodoActions({ resetTodos, deleteCompletedTodos, completedTodosExist}) {
    return (
        <>
        <Button title="Перезагрузить все задачи" onClick={resetTodos}>
            <RiRefreshLine />
        </Button>
        <Button title="Удалить все завершенные задачи" onClick={deleteCompletedTodos} dis>
            <RiDeleteBin2Line />
        </Button>
        </>
    )
}

export default TodoActions;
